import React from "react";
import styled from "styled-components";

const OptionButton = styled.button`
  // 여기에 스타일 추가
`;

export default function SelectRecommendation({ onSelect }) {
  return (
    <>
      <OptionButton onClick={() => onSelect("preference")}>
        취향대로 추천
      </OptionButton>
      <OptionButton onClick={() => onSelect("random")}>랜덤 추천</OptionButton>
    </>
  );
}
